import {useState} from "react";
import React from 'react';

const Contact = () =>{

  const [user, setUser] = useState({
    name:"", email:"", phone:"", msg:""});

    let name, value;
    const handleInputs = (e) =>{
      console.log(e);
      name = e.log(e)
    }




  return (
      <>
     <div className='my-5'>
       <h1 className='text-center'>  Get in Touch</h1>
       </div>
         <div className='container contact_div'>
           <div className='row'>
             <div className='col-md-6 col-10 mx-auto'></div>
               
               <form>
               <div class="mb-3">
  <label for="exampleFormControlInput1" class="form-label">Full Name</label>
  <input type="text" name="name" class="form-control" id="exampleFormControlInput1" 
  
  value={user.name}
  onChange={handleInputs}

  
  
  placeholder="Enter your full name"/>
</div>


<div class="mb-3">
  <label for="exampleFormControlInput1" class="form-label">Email address</label>
  <input type="email" name="email" class="form-control" id="exampleFormControlInput1" 
  
  value={user.email}
  onChange={handleInputs}
  
  
  placeholder="name@example.com"/>
</div>

<div class="mb-3">
  <label for="exampleFormControlTextarea1" class="form-label">Phone No.</label>
  <input type="number" name="phone" class="form-control" id="exampleFormControlInput1" 
  
  value={user.phone}
  onChange={handleInputs}
  
  placeholder="Enter your phone number"/>
</div>

<div class="mb-3">
  <label for="exampleFormControlInput1" class="form-label">Message</label>
  <input type="message" name="msg" class="form-control" id="exampleFormControlInput1" 
  
  value={user.msg}
  onChange={handleInputs}
  
  placeholder=""/>
</div>
<div class="col-12">
    <button class="btn btn-outline-primary" type="submit">Submit form</button>
  </div>
</form>


               
              
            </div>
             </div>
         
       
    </>
  );
};

export default Contact
